import {
  Box,
  Button,
  Card,
  CardActions,
  CardContent,
  Container,
  Grid,
  Typography,
  Dialog,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  DialogTitle,
  DialogContent,
  DialogContentText,
  DialogActions,
  Divider,
  CardMedia,
} from "@mui/material";
import SendIcon from "@mui/icons-material/Send";
import { useEffect, useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";
import "swiper/css/effect-coverflow";
import { Pagination, Navigation, EffectCoverflow } from "swiper";

const Services = () => {
  
  const [open, setOpen] = useState(false);
  const [service, setService] = useState(servicess[0]);
  const openDrawer = (o, s) => {
    setOpen(o);
    setService(s);
    console.log(`open:${o} service:${s.title}`);
  };
  const handleClose = () => {
    setOpen(false);
    setTimeout(() => {
      window.location.href = "#contact";
    }, 500);
  };
  return (
    <Container sx={{ py: 5, backgroundColor: "" }}>
      <Typography
        variant="h2"
        sx={{
          textAlign: "center",
          color: "#000032",
          mb: 3,
          fontWeight: "bold",
        }}
      >
        Servicios
      </Typography>
      <Typography
        variant="h4"
        sx={{
          color: "#f99f00",
          mb: 3,
          fontWeight: "bold",
          textAlign: "center",
        }}
      >
        Impulsamos la conciencia ambiental y la cultura de seguridad y salud en
        el trabajo
      </Typography>
      <Swiper
        grabCursor={true}
        pagination={{
          clickable: true,
        }}
        navigation={true}
        spaceBetween={20}
        slidesPerView={3}
        modules={[Pagination, Navigation]}
        className="mySwiper"
      >
        {<SwiperSlide>
          <Card elevation={5} sx={{ width: "100%" }}>
            <CardMedia sx={{ height: 170 }}>
              <img
                src="images/service2.jpeg"
                alt=""
                srcset=""
                style={{ objectFit: "fill", width: "100%", height: "100%" }}
              />
            </CardMedia>
            <CardContent
              sx={{ textOverflow: "...", height: 100, overflow: "hidden" }}
            >
              <Typography gutterBottom variant="h6" component="div">
                IMPLEMENTACION DEL SG-SSTaaaa
              </Typography>
              <Typography
                variant="body2"
                color="text.secondary"
                sx={{ textAlign: "justify" }}
              >
                La Implementación de seguridad y salud en el trabajo le ayudará
                a garantizar que su empresa cumple con todos los estándares
                legales, así como con los estándares de seguridad y salud. Esto
                significa que sus empleados estarán seguros y protegidos, y su
                empresa no tendrá que enfrentar posibles sanciones o multas por
                incumplimiento de la legislación.
              </Typography>
            </CardContent>
            <CardActions>
              <Button size="small" sx={{ mx: "auto", mt: 2 }}>
                Ver más
              </Button>
            </CardActions>
          </Card>
        </SwiperSlide>}
      </Swiper>
      <Grid container gap={1} justifyContent="space-around">
        {servicess.map((item) => (
          <Grid item xs={12} md={5} key={item.title}>
            <Card elevation={5} sx={{ height: 350, p: 2 }}>
              <CardContent>
                <Typography
                  variant="h4"
                  sx={{ textAlign: "justify", mb: 2, color: "#f99f00" }}
                >
                  {item.title}
                </Typography>
                <Typography sx={{ textAlign: "justify" }} gutterBottom>
                  {item.about}
                </Typography>
              </CardContent>
              <CardActions
                sx={{
                  display: "flex",
                  justifyContent: "center",
                }}
              >
                <Button
                  sx={{ mt: "auto", fontWeight: "bold" }}
                  onClick={() => openDrawer(true, item)}
                >
                  Ver más
                </Button>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>
      <Dialog fullWidth={true} open={open} onClose={() => setOpen(false)}>
        <DialogTitle>
          <Typography
            variant="h4"
            sx={{ color: "#f99f00", textAlign: "center" }}
          >
            {service.title}
          </Typography>
        </DialogTitle>
        <DialogContent>
          <DialogContentText>
            <Typography sx={{ textAlign: "justify", color: "black" }}>
              {service.about}
            </Typography>
            <Box>
              <List>
                {service.items.map((item, index) => (
                  <ListItem key={index}>
                    <ListItemIcon>
                      <SendIcon sx={{ color: "#000032" }} />
                    </ListItemIcon>
                    <ListItemText primary={item} sx={{ color: "black" }} />
                  </ListItem>
                ))}
              </List>
            </Box>
          </DialogContentText>
        </DialogContent>
        <Divider />
        <DialogActions>
          <Button
            component="a"
            variant="contained"
            sx={{ width: "100%", backgroundColor: "#000032" }}
            onClick={handleClose}
          >
            Contactanos
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
};

export default Services;
